import React from 'react';
import { get } from 'http';


export default class profile extends React.Component{
    constructor(props){
        super(props);
        this.state={};
    }
    async componentWillMount(){
        const data = await get(
           '/data/user/get',
           {'Content-Type':'application/json'}
        )
        this.setState({data:data.json()});
        console.log("sfdgjlg");
    }
    render(){
        return(
            <div>heyy</div>
        );
    }
}
